import React from "react";
import { Row, Col } from "react-bootstrap";
import "../products";

const homeScreen = () => {
  return (
    <>
      <h1>Latest Products</h1>
      <Row>
        products.map((product) => (<Col>{product.title}</Col>
        ))
      </Row>
    </>
  );
};

export default homeScreen;
